import React from 'react';
import DayJS from 'react-dayjs';

const Header = () => {
  let now = new Date()

  return (
    <header>
        <h1>Grocery List</h1>
        <DayJS format='dddd MMMM D, YYYY'>{now}</DayJS>
    </header>
  );
}

export default Header;
